import React from 'react';
import { InputWrapper } from './style';
const Input = props => {
    const {
        type,
        name,
        value,
        placeholder,
        className,
        onChange,
        id,
        nameLabel
    } = props;
    return(
        <InputWrapper name>
                <label htmlFor={id}>
                {nameLabel}
                </label>
               <input id = {id} className={className} type={type} name={name} value={value} onChange={onChange} placeholder={placeholder}/>
        </InputWrapper>
    );
}
export default Input;
